import React from 'react';
import UsersItem from "./usersItem";

const UsersList = ({users, title}) => {
    return (
        <div>
            <h1>Список участников</h1>
            {users.map((user) =>
                <UsersItem user={user} key={user.id}/>
            )}

        </div>
    );
};

export default UsersList;
